package second;

public class Arrayforeachini {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int all[] = {1,2,3,4,5,6};
		for(int a:all){
			System.out.printf("%d\n",a);
		}
		
		String name[] = {"add","sub","div","mul"};
		for(String a:name){
			System.out.printf("%s\n",a);
		}
		 
	}
}
